              </Link>
              <Link to={`/avombro/${Utente.num_sequencial}`}>
                  <button className="blue-button">
                    <CIcon icon={cilUserX} />
                  </button>
              </Link>
                {/*
                <Link to={`/edit/${Utente.num_sequencial}`}>
                  <button className="blue-button">
                    <CIcon icon={cilUser} />
                  </button>
                </Link>
                */}
            </td>
            </tr>
          ))}
      </tbody>
    </table>
        </div>
    );
